        <div class="ph-install-step ph-installinstructions-step1-of5">
            <h1>1</h1>
            <p class="larger-font-size">Click <strong>Save File</strong><br>when the download<br>window pops up</p>
            <img width="168" height="125" data-delaysrc="https://web.archive.org/web/20161213190830/https://images.rbxcdn.com/635085abe343ceec97e5da00103cbd8d.png" src="https://web.archive.org/web/20161213190830im_/https://images.rbxcdn.com/635085abe343ceec97e5da00103cbd8d.png" class="src-replaced">
        </div>
        <div class="ph-install-step ph-installinstructions-step2-of5">
            <h1>2</h1>
            <p class="larger-font-size">Go to Downloads and<br>double click<br><strong>RobloxPlayer.exe</strong></p>
            <img width="168" height="125" data-delaysrc="https://web.archive.org/web/20161213190830/https://images.rbxcdn.com/4791f147e474426b284e7885b8f91635.png" src="https://web.archive.org/web/20161213190830im_/https://images.rbxcdn.com/4791f147e474426b284e7885b8f91635.png" class="src-replaced">
