        <div class="ph-install-step ph-installinstructions-step3-of5">
            <h1>3</h1>
            <p class="larger-font-size">Click <strong>Run</strong></p>
            <img width="168" height="125" data-delaysrc="https://web.archive.org/web/20161213190830/https://images.rbxcdn.com/27e0e77ae7b5d726ca231c5d338fa473.png" src="https://web.archive.org/web/20161213190830im_/https://images.rbxcdn.com/27e0e77ae7b5d726ca231c5d338fa473.png" class="src-replaced">
        </div>
        <div class="ph-install-step ph-installinstructions-step4-of5">
            <h1>4</h1>
            <p class="larger-font-size">Once installed, click <strong>Play</strong><br>to join the action!</p>
            <div class="VisitButton VisitButtonContinueGLI">
                <a class="btn btn-primary-lg disabled">Play</a>
            </div>
        </div>
        <div class="ph-install-step ph-installinstructions-step5-of5">
            <h1>5</h1>
            <p class="larger-font-size">Click <strong>Ok</strong> when the alert<br>pops up</p>
            <img width="168" height="125" data-delaysrc="https://web.archive.org/web/20161213190830/https://images.rbxcdn.com/f024c63845c2f79d30ccebe2b2f5818d.png" src="https://web.archive.org/web/20161213190830im_/https://images.rbxcdn.com/f024c63845c2f79d30ccebe2b2f5818d.png" class="src-replaced">
